 * This software is released under MIT license.
 * The full license information can be found in LICENSE in the root directory of this project.
 */
export const AnimationAccordionPanelOpenName = 'cds-accordion-panel-open';
export const AnimationAccordionPanelOpenConfig = [
    {
        target: '.accordion-content',
        animation: [
            { opacity: 0, height: '0' },
            { opacity: 1, height: 'from:cds-accordion-content' },
        ],
        options: {
            duration: '--animation-duration',
            easing: '--animation-easing',
            fill: 'forwards',
        },
    },
];
//# sourceMappingURL=cds-accordion-panel-open.js.map
